float NpartNormalizer::weight(int npp, TString compare_case)
{
    if (npp < 101 || npp > 200) return 0;
    if (compare_case == "ox")   return ratio_ox[npp];
    if (compare_case == "oxb")  return ratio_oxb[npp];
    if (compare_case == "obx")  return ratio_obx[npp];
    if (compare_case == "obxb") return ratio_obxb[npp];

    if (compare_case == "x")  return ratio_x[npp];
    if (compare_case == "xb") return ratio_xb[npp];
    if (compare_case == "o")  return ratio_o[npp];
    if (compare_case == "ob") return ratio_ob[npp];
    
    return 0;
}


